import React from 'react';
import { Table } from 'reactstrap';

export class Row extends React.Component {
  getData = () => {
    return (Object.values(this.props.data).forEach( value => {
       <td className="document-list-item">{value}</td>
    }));
  }

  render() {
    return (
      <Table>
        <tbody>
          <tr>
            {this.getData()}
          </tr>
        </tbody>
      </Table>
    );
  }
}
